import React from "react"
import './list.css' 

export const List = ({people}) => {
    return (
        <>
            {people.map((person) => {
                const {id,name,age ,image} = person;
                return(
                    <article key={id} >
                        <div className="image">
                            <img src={image}  alt= {name}/>
                        </div>
                        
                        <div>
                            <h4>{name}</h4>
                            <p>{age}</p>
                        </div>
                    </article>
                )
        })}
        
        </>
    ) 


}
